import React from "react";

const AboutPage = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Who we are</h1>
      <p>
        Nelson White is a seasoned innovation leader with over seven years of experience in finance,
        specializing in driving digital transformation and fostering business growth through emerging technologies.
        He has successfully spearheaded strategic initiatives in collaboration with industry leaders, delivering innovative solutions across diverse sectors,
        including finance, retail, and healthcare. Nelson’s expertise includes blockchain, decentralized finance, and design thinking,
        with a focus on building sustainable and future-ready business models.
      </p>
      <p>
        With an MBA from UNC’s Kenan-Flagler Business School and a certificate in Sustainable Enterprise from the Ackerman Center for Excellence in Sustainability,
        Nelson is dedicated to helping businesses and individuals navigate the rapidly evolving digital landscape and embrace the full potential of decentralized technologies.
      </p>
    </div>
  );
};

export default AboutPage;
